<template>
    <div class="step-title">Upload logos to desired positions (png or pdf)</div>
    <div class="text-xs text-italic italic">
        You can click position on the preview to select a file or simply drag the file to the position from your computer.
    </div>
    <div class="py-2 flex items-center gap-10" v-if="loading">
        <img style="width: 18px; height: 18px;" src="data:image/gif;base64," alt="">
        Please wait, loading...</div>
    <div v-else>
        <category-template-upload :images="images" :project_id="project_id" @changed="$event=>changed($event, category)"/>
    </div>
</template>

<script>
    import categoryTemplateUpload from './category-template-upload.vue'
    import axios from 'axios'
    export default {
        components: {
            categoryTemplateUpload
        },
        props: {
            categories: {
                type: Array
            },
            project_id: {
                type: String
            },
            id: {
                type: String
            }
        },
        data(){
            return {
                images: [],
                loading: true
            }
        },
        mounted(){
            setTimeout(()=>{
                this.load()
            }, 400)
        },
        watch: {
            id() {
                this.load()
            }
        },
        methods: {
            load(){
                this.loading = true
                axios.get('/json/patronage?id='+this.id).then(response=>{
                    this.images = JSON.parse(response.data.images)
                    this.loading = false
                })
            },
            changed(data, category){
                this.$emit('changed', {category: category, images: data})
            }
        }
    }
</script>